CREATE DEFINER=`root`@`%` PROCEDURE `get_id_for_path`(IN PATHSTR VARCHAR(255),OUT id int unsigned)
BEGIN
SET @id=null;
SET @sql = concat("with  recursive a(Parent,Name,CategoryId,level,pathstr) as 
( 
   select t1.parent,t1.name,t1.category_id,0 as level,cast(t1.name as char(255)) as pathstr from categorys as t1
   where t1.parent is null
   union all
   select t2.parent,t2.name,t2.category_id,ct.level+1,concat(ct.pathstr,'\', t2.name) as pathstr from a ct
   join categorys as t2
   on (t2.parent=ct.CategoryId)
 
)

select CategoryId into @id from a 
where pathstr = ",pathstr," limit 1" );
PREPARE stmt FROM @sql;
EXECUTE stmt;
Set id = @id;
DROP PREPARE stmt;
END ;;
