CREATE DEFINER=`root`@`%` PROCEDURE `get_pathstr`( IN cat_name VARCHAR(60),
                                 IN sub_cat2_name VARCHAR(60),
								 IN sub_cat3_name VARCHAR(60),
                                 IN sub_cat4_name VARCHAR(60),
                                 OUT pathstr VARCHAR(255))
BEGIN
  declare v0 varchar(255);
  if (cat_name <> '') then
        set v0=concat(cat_name);
        if (sub_cat2_name <> '') then
	      set v0=concat_ws('.',v0,sub_cat2_name);
          if (sub_cat3_name <> '') then
           set v0=concat_ws('.',v0,sub_cat3_name);
            if (sub_cat4_name <> '') then
             set v0=concat_ws('.',v0,sub_cat4_name);
            end if; 
          end if; 
        end if;  
      end if; 
Set v0=concat('\"',v0,'\"');      
Set pathstr=REPLACE(v0, '.', '\\');

END ;;
