CREATE DEFINER=`root`@`%` PROCEDURE `insert_cat_if_not_exist`(IN cat VARCHAR(40),IN cat_id0 int,OUT cat_id int)
BEGIN
 DECLARE cnt int;
  
 select count(category_id) into cnt  from  categorys 
       where  name = cat limit 1;
       if (cnt = 0) then
