CREATE DEFINER=`root`@`%` PROCEDURE `insert_prices_tr`(IN prod_id int unsigned,IN amount decimal)
BEGIN
SET TRANSACTION ISOLATION LEVEL READ COMMITTED;
set autocommit=0;
select @next_day:='0 23:59:59',@max_date:='9999-12-31 23:59:59';
start transaction;
update prices set date_to=adddate(date(now()), INTERVAL @next_day DAY_SECOND) 
where price_id in (select last_price_id from products where product_id=@prod_id);
insert into prices (price_id,product_id,currency_id,date_from,date_to,amount_base) 
select null,@prod_id,1,@from:=adddate(date(now()), INTERVAL 1 DAY),@max_date,amount; 
update products set last_price_id=last_insert_id() 
where product_id=@prod_id;
commit; 
END ;;
