CREATE DEFINER=`root`@`%` PROCEDURE `products_from_x`(IN tbl VARCHAR(80))
BEGIN
DECLARE Done INT;
DECLARE name_s VARCHAR(80);
DECLARE price_s VARCHAR(20);
DECLARE manuf VARCHAR(40);
DECLARE color_s VARCHAR(20);
DECLARE manuf_id INT UNSIGNED;
DECLARE cnt INT;
DECLARE cat_name VARCHAR(60);
DECLARE sub_cat2_name VARCHAR(60);
DECLARE sub_cat3_name VARCHAR(60);
DECLARE sub_cat4_name VARCHAR(60);


DECLARE curs CURSOR FOR SELECT cat,sub_cat2,sub_cat3,sub_cat4,name,price,manufacturer,color FROM vw_products_from_x
                        where propertys not like '<table>%'
                        order by manufacturer;
DECLARE curs_cat CURSOR FOR SELECT cat,sub_cat2,sub_cat3,sub_cat4  FROM vw_products_from_x
                        group by cat,sub_cat2,sub_cat3,sub_cat4;                        
DECLARE CONTINUE HANDLER FOR NOT FOUND SET Done = TRUE;
set @max_date  = '9999-12-31 23:59:59';
-- currency
insert ignore into currency (symbol,short_name) 
select '₽','RU';
-- 
SET @select = concat('CREATE VIEW vw_products_from_x as SELECT * FROM ', tbl);
    PREPARE stm FROM @select;
    EXECUTE stm;
    DEALLOCATE PREPARE stm;
 --   SET @cnt = FOUND_ROWS(); 
 --   SELECT @cnt;
OPEN curs_cat;
  
  SET Done = FALSE;
  read_loop:LOOP
    FETCH curs_cat INTO cat_name,sub_cat2_name,sub_cat3_name,sub_cat4_name;
  -- 
    IF done THEN
      LEAVE read_loop;
    END IF;
      
      if (cat_name <> '') then
        call insert_cat_if_not_exist(cat_name,null,@cat_id);
        if (sub_cat2_name <> '') then
	      call insert_cat_if_not_exist(sub_cat2_name,@cat_id,@cat_id);
          if (sub_cat3_name <> '') then
           -- call insert_cat_if_not_exist(sub_cat3_name,@cat_id,@cat_id);
           insert into categorys (name,parent)
           values(sub_cat3_name,@cat_id);
           set @cat_id = last_insert_id();
           if (sub_cat4_name <> '') then
             call insert_cat_if_not_exist(sub_cat4_name,@cat_id,@cat_id);
            end if; 
          end if; 
        end if;  
      end if; 
      
   --     
    
  END LOOP;

  CLOSE curs_cat;
  DROP VIEW vw_products_from_x;

    SET @select = concat('CREATE VIEW vw_products_from_x as SELECT * FROM ', tbl);
    PREPARE stm FROM @select;
    EXECUTE stm;
    DEALLOCATE PREPARE stm;

  OPEN curs;
  
  SET Done = FALSE;
  read_loop1:LOOP
    FETCH curs INTO cat_name,sub_cat2_name,sub_cat3_name,sub_cat4_name,name_s,price_s,manuf,color_s;
  -- 
       IF DONE then
          LEAVE read_loop1;
       END IF;
       select count(manufacturer_id) into cnt  from  manufacturers 
       where  manufacturer = manuf limit 1;
       if (cnt = 0) then
         insert into manufacturers (manufacturer,address,email,country)
         values(manuf,'',null,null);
         select manufacturer_id into manuf_id  from  manufacturers 
         where  manufacturer = manuf limit 1;
       end if;
	 
   --  product   
  
       call get_pathstr(cat_name,sub_cat2_name,sub_cat3_name,sub_cat4_name,@pathstr);
	   call get_id_for_path(@pathstr,@id);
       insert into products (name,manufacturer_id,category_id,propertys,last_price_id)
       values(name_s,manuf_id,@id,json_object('color',color_s),null);
       set @prod_id = last_insert_id();
 -- price
set @prob=LOCATE(' ', price_s);
set @part_one= SUBSTRING( price_s,1,@prob-1);
set @part_two= SUBSTRING( price_s,@prob+1);

insert into prices (product_id,currency_id,date_from,date_to,amount_base) 
select @prod_id,1,@from:=subdate(date(now()), INTERVAL 31 DAY),@max_date,
CAST(concat(@part_one,@part_two) as decimal(10,2)); 
update products set last_price_id=last_insert_id() 
where product_id=@prod_id;

    
 END LOOP;

  CLOSE curs;
  DROP VIEW vw_products_from_x;

END ;;
